data.text:
@juanlula @sanchezcastejon @ahorapodemos irá a elecciones cuando toque. Veremos quién se suicida. 
@sanchezcastejon tiene q conseguir apoyos para ser investido. Las medidas sociales le importan una 💩 y las económicas se las dicta el IBEX.
X eso no dejan entrar a UP en el gobierno.

@TheoBloom_ Pero aquello no era una misión suicida y nadie debía acabar herido. Dexter ya había dispuesto el lugar donde se quedarían al menos aquella noche/día.

—No es como si no lo supiese...

Tenía su expediente, sabía de donde venía. No era casual no haber elegido aquel lugar. »

@TeamEstinzione Un attimo, quella del suicidio non l'ho capita, nel senso che mi manca il lato consono a TE:

Va in viaggio di nozze, torna e si suicida? così anche padre e nonno, che però hanno ovviamente fatto in tempo a procreare prima di morire? 

Se non manca nulla non c'è il momento comico

